  let [id, setId] = useState("");
  document.body.style = 'background: yellow;';


  return (

    <div className="flex justify-center">
      <div className="bg-pink-200 mt-8 p-3 text-center border-yellow-200 border-8 rounded-lg">



        <div className="flex justify-center m-3">
        <p>
          Passwort: &nbsp;
        </p>
        <input
          value={id}
          onChange={e =>  (id.length >= 5) ? undefined :

              setId(e.target.value)

          }
        />
        </div>

        <Link to={"/quiz/" + id}>
          Hello
        </Link>
      </div>
    </div>
  )
}

export default Home;
